import styled from "styled-components";

const SearchResultsStyles = styled.div`
  .grid {
    display: grid;
    grid-template-columns: repeat(3, 200px);
  }

  .col:nth-last-child(2) {
    grid-column-start: 2;
  }

  .col {
    max-height: 220px;
  }
`;
export default SearchResultsStyles;
